swagger: '2.0'
info:
  version: "1.1.0.7"
  title: Solartis Rate API for ISO Commercial Auto
  description: To get rate for Commercial Auto from Solartis Rate 
    API with ISO ERC.
host: starrca.beta.solartis.net
basePath: /KnowledgeEngineV6_2/KnowledgeBase
schemes:
  - https
produces:
  - application/json
consumes:
  - application/json
paths:
  /FireEventV2:
    post:
      description: Gets Rate for Commercial Automobile
      operationId: getRates
      produces: 
        - application/json
      parameters:
        - name: Token
          in: header
          description: Authentication Token
          required: true
          type: string
          format: string
          default: ""
      
        - name: Content-Type
          in: header
          description: Content Type
          required: true
          type: string
          format: string
          default: "application/json"
          
        - name: EventName
          in: header
          description: EventName
          required: true
          type: string
          format: string
          default: "StarrCARate"
          
        - name: EventVersion
          in: header
          description: EventVersion
          required: true
          type: string
          format: string
          default: "1.1.0.6"
          
        - name: Rating Request
          in: body
          description: For rating request
          required: true
          schema:
            $ref: '#/definitions/Rating_Request'
      responses:
        '200':
          description: Successful response
          schema:
            $ref: '#/definitions/Rating_Success_Response'
        default:
          description: unexpected error
          schema:
            $ref: '#/definitions/errorModel'
